import InputRow from "./row/InputRow";
import './register.css'
import Box from "./Box";

export default function RegisterUsers() {

    return (

        <div className="main">
             <Box>
                <h1>Top Box</h1>
                <p>Some text in top box</p>
              </Box>

              <Box>
                <h1>Bottom Box</h1>
                <p>Some text in bottom box</p>
                <button>Click Me!</button>
              </Box>
        </div>
    )
}
